import React from 'react';

const NotToDo = ({nottodo}) =>{
    const nottodoList = nottodo.length ? (
        nottodo.map(notodo => {
            return (
                <div>
                    <span>{notodo.content}</span>
                </div>
            )
        })
    ) : (
        <p>
            Not todos anymore
        </p>
    )
    return(
        <div>
            <h1 className='center'>
                Not To Do
            </h1>
        </div>
    )
}

export default NotToDo;
